import React, { useState } from 'react';
import Step1 from './Step1';
import Step2 from './Step2';
import Step3 from './Step3';
import Step4 from './Step4';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLock, faUser, faCamera, faCheck } from '@fortawesome/free-solid-svg-icons';

const SignupForm = () => {
    const [step, setStep] = useState(1);
    const [formData, setFormData] = useState({
        email: '', username: '', password: '', confirmPassword: '',
        firstName: '', lastName: '', contactNo: '',
        photo: null
    });

    const nextStep = () => setStep(step + 1);
    const prevStep = () => setStep(step - 1);
    const handleFormData = (data) => setFormData({ ...formData, ...data });

    const renderProgressBar = () => (
        <div className="w-full flex items-center justify-between mb-4">
            <div className={`flex-1 relative ${step >= 1 ? "text-purple-600" : "text-gray-300"}`}>
                <div className="absolute left-0 right-0 mx-auto w-8 h-8 flex items-center justify-center">
                    <FontAwesomeIcon icon={faLock} />
                </div>
                <div className={`border-b-4 ${step >= 1 ? "border-purple-600" : "border-gray-300"} pb-2`}></div>
            </div>
            <div className={`flex-1 relative ${step >= 2 ? "text-purple-600" : "text-gray-300"}`}>
                <div className="absolute left-0 right-0 mx-auto w-8 h-8 flex items-center justify-center">
                    <FontAwesomeIcon icon={faUser} />
                </div>
                <div className={`border-b-4 ${step >= 2 ? "border-purple-600" : "border-gray-300"} pb-2`}></div>
            </div>
            <div className={`flex-1 relative ${step >= 3 ? "text-purple-600" : "text-gray-300"}`}>
                <div className="absolute left-0 right-0 mx-auto w-8 h-8 flex items-center justify-center">
                    <FontAwesomeIcon icon={faCamera} />
                </div>
                <div className={`border-b-4 ${step >= 3 ? "border-purple-600" : "border-gray-300"} pb-2`}></div>
            </div>
            <div className={`flex-1 relative ${step === 4 ? "text-purple-600" : "text-gray-300"}`}>
                <div className="absolute left-0 right-0 mx-auto w-8 h-8 flex items-center justify-center">
                    <FontAwesomeIcon icon={faCheck} />
                </div>
                <div className={`border-b-4 ${step === 4 ? "border-purple-600" : "border-gray-300"} pb-2`}></div>
            </div>
        </div>
    );

    const renderStepIndicator = () => (
        <div className="text-right text-gray-500 font-bold mb-4">
            Step {step} - 4
        </div>
    );

    return (
        <div className="w-full max-w-lg mx-auto mt-10 bg-white p-6 rounded-lg shadow-md">
            <h2 className="text-2xl font-bold text-center text-purple-600 mb-4">SIGN UP YOUR USER ACCOUNT</h2>
            <p className="text-center text-gray-500 mb-4">Fill all form fields to go to the next step</p>
            {renderProgressBar()}
            {renderStepIndicator()}
            {step === 1 && <Step1 nextStep={nextStep} handleFormData={handleFormData} values={formData} />}
            {step === 2 && <Step2 nextStep={nextStep} prevStep={prevStep} handleFormData={handleFormData} values={formData} />}
            {step === 3 && <Step3 nextStep={nextStep} prevStep={prevStep} handleFormData={handleFormData} values={formData} />}
            {step === 4 && <Step4 prevStep={prevStep} />}
        </div>
    );
};

export default SignupForm;
